import React from 'react';

const NewIssue = () => {
	return (
		<div>
			<form action="/create-issue" method="POST" style={{display: "flex"}}>
				<div class="col-sm-1"> </div>
				<div class="col-sm-9 newIssue">
					<input class="issueTitle" type="text" placeholder="  Title" name="title" />
					<input id="markdown-editor" type="textarea" value="" name="editor" placeholder="Leave a comment" />
					<button class="btn btn-success btnSubmit">Submit new issue</button>
				</div>
			</form>
		</div>
	);
};

export default NewIssue;
